    Skulls(String texture) {
        this.texture = texture;
    }

    public static List<Skulls> numToSkull(int num) {
        List<Skulls> list = new ArrayList<>();
        String numstring = String.valueOf(num);
        for (char c : numstring.toCharArray()) {
            switch (c) {
                case '1':
                    list.add(BLACK1);
                    break;
                case '2':
                    list.add(BLACK2);
                    break;
                case '3':
                    list.add(BLACK3);
                    break;
                case '4':
                    list.add(BLACK4);
                    break;
                case '5':
                    list.add(BLACK5);
                    break;
                case '6':
                    list.add(BLACK6);
                    break;
                case '7':
                    list.add(BLACK7);
                    break;
                case '8':
                    list.add(BLACK8);
                    break;
                case '9':
                    list.add(BLACK9);
                    break;
                case '-':
                    list.add(BLACKMINUS);
                    break;
                default:
                    list.add(BLACK0);
            }
        }

        return list;
    }

    public ItemStack getSkull(ILandLord plugin) {
        UUID uuid = UUID.randomUUID();
        if (texture.isEmpty())
            return plugin.getMaterialsManager().getPlayerHead(uuid);

        ItemStack head = new ItemStack(plugin.getMaterialsManager().getSkull());
        SkullMeta headMeta = (SkullMeta) head.getItemMeta();
        GameProfile profile = new GameProfile(uuid, null);

        profile.getProperties().put("textures", new Property("textures", texture));

        try {
            Field profileField = headMeta.getClass().getDeclaredField("profile");
            profileField.setAccessible(true);
            profileField.set(headMeta, profile);
        } catch (IllegalArgumentException | NoSuchFieldException | SecurityException | IllegalAccessException error) {
            error.printStackTrace();
        }
        head.setItemMeta(headMeta);
        return head;
    }

    @Override
    public String toString() {
        return "Skulls{" +
                this.name() +
                '}';
    }
